pragma solidity ^0.8.19;

// SPDX-License-Identifier: MIT

contract MLM {
    address[] public entrylist;
    mapping(address => mapping(uint256 => address)) public container;
    uint public lengthoflist;
    function add() public {
        if (checkentry()) {
            entrylist.push(msg.sender);
        }
        lengthoflist = entrylist.length;
    }

    function checkentry() private view returns (bool) {
        bool flag = true;
        for (uint256 i; i < entrylist.length; i++) {
            if (entrylist[i] == msg.sender) {
                flag = false;
                break;
            }
        }
        return flag;
    }

    function nestedadd() public {
        for (uint256 i = 0; i < entrylist.length; i++) {
            if (((i * 2) + 1) < entrylist.length) {
                container[entrylist[i]][0] = entrylist[(i * 2) + 1];
            }
            if (((i * 2) + 2) < entrylist.length) {
                container[entrylist[i]][1] = entrylist[(i * 2) + 2];
            }
        }
    }

    function checkchild (address parentaddress, uint index) public view returns (address){ 
     return container[parentaddress][index];
    }
}

